const Heading = (props) =>{
    return <h1>{props.text}</h1>
}

const UlList = (props) => {
   return <ul>{props.text}</ul>
}

function TodoList () {
return (
    <div>
    <Heading text = "ToDo List"/>
    </div>
)
}

export default TodoList
